import React from 'react';
import './Section.css'

// sections
import AboutMeBlurb from '../Blurbs/AboutMeBlurb';

const Section = (props) => {

    let content = null;

    switch (props.id) {
        case 'aboutme':
            return (
                <AboutMeBlurb />
            );
            break;
    }

    return (
        <div id={props.id} className="section">
            <div className="section__content">
                <h1 className='section__content-title'>{props.title}</h1>
            </div>
            <div className="section__overlay"></div>
      </div>
    );
}

export default Section;
